import '../styles/about.css';
import aboutBlob from "../images/about-pic.png";

function About() {
  return (
    <>  
    <div class = "section">
        <div class = "about-container">
                <img src={aboutBlob} class = "about-image"></img>
                <div>
                    <div>Title</div>
                    <div>Description</div>
                    <div></div>
                </div>
            </div>
    </div>

    </>
  );
}

export default About;
